import { ValuesType } from "types/types";

interface Props {
  values: ValuesType;
}

export const Check = ({ values }: Props) => {
  console.log(values);

  return (
    <div>
      {values.lastname}
      {values.firstname}
      {values.birth.month}
      {values.birth.date}
      {values.birth.year}
      {values.gender}
      {values.email}
      {values.id.id}
      {values.id.pw}
    </div>
  );
};

export default Check;
